var savedDpi1;

var vLedNames = ["Left Zone", "Logo Zone", "Right Zone"];
var vLedPositions = [
    [0,1],[1,2],[2,1]
];
var oldpacket = [];
export function LedNames()
{
    return vLedNames;
}

export function LedPositions()
{
    return vLedPositions;
}


export function Initialize()
{
    if(savedDpi1 != dpi1 && DpiControl) {
        setDpi(dpi1);
    }
    Off();
}

export function Off()
{
    device.set_endpoint(1, 0x0002, 0xff00); // Lighting IF
    var packet = [];
       //Header
       packet[0x00] = 0x11;
       packet[0x01] = 0xFF;
       packet[0x02] = 0x0E;
       packet[0x03] = 0x1A;
       //Common Data
       packet[0x04] = 0x00;
       packet[0x05] = 0x00;
       packet[0x06] = 0x00;
       packet[0x07] = 0x00;
       packet[0x08] = 0x00;     
       //END BYTE
       packet[0x10] = 0x01;
       device.write(packet, 20);
       device.read(packet, 20);
}

function setDpi(dpi){

    device.set_endpoint(1, 0x0001, 0xff00); // System IF    
    savedDpi1 = dpi1;

    var packet = [];
    packet[0] = 0x10;
    packet[1] = 0xFF;
    packet[2] = 0x0A;
    packet[3] = 0x3A;
    packet[4] = 0x00;
    packet[5] = Math.floor(dpi/256);
    packet[6] = dpi%256;
    device.write(packet, 7);
    device.read(packet, 7);
    device.pause(1);  
}

function wait(ms){
    var start = new Date().getTime();
    var end = start;
    while(end < start + ms) {
      end = new Date().getTime();
   }
 }

function Apply()
{
    var packet = [];
    
    packet[0x00] = 0x11;
    packet[0x01] = 0xFF;
    packet[0x02] = 0x12;
    packet[0x03] = 0x7A;
    device.read(packet, 20);
    device.write(packet, 20);
    device.pause(1);
}

function sendColor(oldpacket){
    device.set_endpoint(1, 0x0002, 0xff00); // Lighting IF    

    var packet = [];

    packet[0x00] = 0x11;
    packet[0x01] = 0xFF;
    packet[0x02] = 0x12;
    packet[0x03] = 0x1E;

    var offset = 4;
    for (var iIdx = 0; iIdx <= 2; iIdx++)
    {
        var iLedIdx = offset + (iIdx * 4);
        var iX = vLedPositions[iIdx][0];
        var iY = vLedPositions[iIdx][2];
        var color;
        if (LightingMode == "Forced") {
            color = hexToRgb(forcedColor)
        }else{
            color = device.color(iX, iY);
        }
        packet[iLedIdx] = iIdx + 1;
        packet[iLedIdx+1] = color[0];
        packet[iLedIdx+2] = color[1];
        packet[iLedIdx+3] = color[2];          
    }
    packet[0x10] = 0xFF;
    if(JSON.stringify(packet)==JSON.stringify(oldpacket)){
        //device.log("same not updating")
    }
    else{
        //device.log("not same updating")
        device.write(packet, 20);
        device.read(packet, 20);
        Apply();
        wait(50);
        //device.log(device.pollReadBuffer())
    }
    return packet;
}

function hexToRgb(hex) {
    var result = /^#?([a-f\d]{2})([a-f\d]{2})([a-f\d]{2})$/i.exec(hex);
    var colors = [];
    colors[0] = parseInt(result[1], 16);
    colors[1] = parseInt(result[2], 16);
    colors[2] = parseInt(result[3], 16);

    return colors;
  }
export function Render()
{   
    if(savedDpi1 != dpi1 && DpiControl){
        setDpi(dpi1)
    }

    if(Ledoff){
        Off();
    }
    else{
        var packet = sendColor(oldpacket);
        oldpacket = packet;
    }   
}


export function Shutdown()
{
    Off();
}

export function Validate(endpoint)
{
    return endpoint.interface === 1 && endpoint.usage === 0x0001 && endpoint.usage_page === 0xff00 || endpoint.interface === 1 && endpoint.usage === 0x0002 && endpoint.usage_page === 0xff00;
}

